const App = () => {
    const [name, setname] = useState("");
    const [naam, setnaam] = useState("");

    const [lname, setlname] =useState("");
    const [lnaam, setlnaam] = useState("");


    const text = (narmeen) => {
        setname(narmeen.target.value);
    
         }
    const textTwo = (narmeen2) => {
      setlname(narmeen2.target.value);
      

    }
     const ClickSubmit = (event) => {
      event.preventDefault();
      setnaam(name);
      setlnaam(lname);
    }
   
   
  return(
    <>
    
    <form onSubmit={ClickSubmit}>
    <div>
    <h1>Hello {naam} {lnaam}</h1>
    <input type='text' placeholder='Enter Your Name' onChange={text} value={name}/>
    <input type='text' placeholder='Enter Your Name' onChange={textTwo} value={lname}/>

    <button type='submit'>Click Me üëç</button>
    </div>
    </form>
   
    </>
   );
};
export default App;
